public class InnerAnalysisDefaultInteractiveLayoutConfigurationFactory(Action<Humidifier.QuickSight.AnalysisTypes.DefaultInteractiveLayoutConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.QuickSight.AnalysisTypes.DefaultInteractiveLayoutConfiguration>
{

    internal InnerAnalysisDefaultFreeFormLayoutConfigurationFactory FreeFormFactory { get; set; }

    internal InnerAnalysisDefaultGridLayoutConfigurationFactory GridFactory { get; set; }

    protected override Humidifier.QuickSight.AnalysisTypes.DefaultInteractiveLayoutConfiguration Create()
    {
        var defaultInteractiveLayoutConfigurationResult = CreateDefaultInteractiveLayoutConfiguration();
        factoryAction?.Invoke(defaultInteractiveLayoutConfigurationResult);

        return defaultInteractiveLayoutConfigurationResult;
    }

    private Humidifier.QuickSight.AnalysisTypes.DefaultInteractiveLayoutConfiguration CreateDefaultInteractiveLayoutConfiguration()
    {
        var defaultInteractiveLayoutConfigurationResult = new Humidifier.QuickSight.AnalysisTypes.DefaultInteractiveLayoutConfiguration();

        return defaultInteractiveLayoutConfigurationResult;
    }
    public override void CreateChildren(Humidifier.QuickSight.AnalysisTypes.DefaultInteractiveLayoutConfiguration result)
    {
        base.CreateChildren(result);

        result.FreeForm ??= FreeFormFactory?.Build();
        result.Grid ??= GridFactory?.Build();
    }

} // End Of Class

